import React, { Component } from 'react'; 
import './App.css';

class App extends Component { 
  render() {
    var helloWorld = 'Welcome to the road to learn react';
    return (
      <div className="App">
        <h2> {helloWorld} </h2>
      </div>
    ); 
  }
}

export default App;
